import React from 'react';
import ReactDOM from 'react-dom';
import './styles/global.css'; // Make sure Tailwind CSS is imported
import App from './App';
import dotenv from "dotenv";

dotenv.config();
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
